// Rush houses or smelter/coal then houses
if (_('TraitLevel', 'powered')) {
    // TODO: Optimize number of coal power plants and houses
    trigger.amount(buildings.Smelter, 1);
    trigger.amount(buildings.CoalPower, 5);

    if (resources.Power.currentQuantity > 1) {
        trigger.amount(buildings.House, 30);
        trigger.amount(buildings.Cottage, 15);
    }

    // Return to force smelter, coal power, and houses to build
    if (buildings.Smelter.count < 1 || buildings.CoalPower.count < 1) {
        return;
    }
}
else {
    trigger.amount(buildings.House, 30);
    trigger.amount(buildings.Cottage, 15);
}
